import { playSongByInput, queueSong, playNextSong } from "./video-controller";
import {controllerEnums } from "../../constants/constants";

export const mappedController = {
  [controllerEnums.PLAY_NOW]: playSongByInput,
  [controllerEnums.PLAY_NEXT]: playNextSong,
  [controllerEnums.QUEUE]: queueSong,
}
